import { NavLink,Route,Routes, useNavigate } from "react-router-dom";
import Home from "./components/Home";
import MainHeader from "./components/MainHeader";
import './App.css'
function App(){
    const navigate = useNavigate;
    function changeHandler(){
        navigate("/");
    }
    return(
        <div className="flex flex-col justify-center items-center">
            <nav >
                <ul>
                    <li>
                        <NavLink to="/">Home</NavLink> 
                    </li>
                    <li>
                        <NavLink to="/about">about</NavLink>
                    </li>
                    <li>
                        <NavLink to="/support">support</NavLink>
                    </li>
                    <li>
                        <NavLink to="/contact">contact us</NavLink>
                    </li>
                </ul>
            </nav>
            <Routes>
                <Route path="/" element={<MainHeader/>}>
                <Route index element={<Home/>} />
                <Route path="/about" element={<div>about me</div>}/>
                <Route path="/support" element={<div>how i can support</div>}/>
                <Route path="/contact" element={<div>you can contact on mob.9876543210
                    <button onClick={changeHandler}>home</button> </div>}/>
                <Route path="*" element={<div>page not found</div>} />
                </Route>
            </Routes>
        </div>
    );
}
export default App;
